.code_box {
    border-style: solid;
    border-width: 1px;
    border-radius: 7px;
    background-color: black;
    font-family: "Consolas";
    font-size: 85%;
}

.code {
    background-color: black;
    color: rgb(125, 129, 129);
    margin-top: 5px;
    margin-bottom: 5px;
    font-family: "Consolas";
    padding-left: 7px;
}

.code_line {
    background-color: black;
    padding-left: 50px;
    overflow: auto;
}

.highlight_none {
    color: rgb(114, 202, 230);
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_word {
    color: rgb(235, 228, 165);
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_symbol {
    color: rgb(233, 96, 96);
    font-weight: bold;
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_number {
    color: rgb(186, 116, 252);
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_comment {
    color: limegreen;
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_line {
    color: rgb(223, 121, 223);
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_before {
    color: rgb(180, 180, 255);
    font-family: "Consolas";
    font-size: 100%;
}

.highlight_str {
    color: rosybrown;
    font-family: "Consolas";
    font-size: 100%;
}
